import { useState } from "react";

const Example = () => {
    const [count, setCount] = useState(0);
    const countUp = () => {
        setCount(c+1)
    }
    const countDown = (c) => {
        setCount(c-1)
    }
  return(
    <>
    <p>現在のカウント数：{count}</p>
    <button onClick={()=>countUp(count)}>+</button>
    <button onClick={()=>countDown(count)}>-</button>
    </>
  )
};

export default Example;
